import React from "react";
import DayPickerInput from 'react-day-picker/DayPickerInput';
import { DataGrid, ColDef, ValueGetterParams } from '@material-ui/data-grid';
import 'react-day-picker/lib/style.css';
import { DateUtils } from 'react-day-picker';
import dateFnsFormat from 'date-fns/format';
import dateFnsParse from 'date-fns/parse';
import ReactTable from "react-table";
//deploye

import { AgGridColumn, AgGridReact } from 'ag-grid-react';
import 'ag-grid-community/dist/styles/ag-grid.css';
import 'ag-grid-community/dist/styles/ag-theme-alpine.css';


function parseDate(str, format, locale) {
  const parsed = dateFnsParse(str, format, new Date(), { locale });
  if (DateUtils.isDate(parsed)) {
    return parsed;
  }
  return undefined;
}
function formatDate(date, format, locale) {
  return dateFnsFormat(date, format, { locale });
}

export default class Dashboard extends React.Component {


  state = { Show: false, Showing: false };
  show = () => {
    if (this.state.Showing) return;

    this.setState({ Show: true, Showing: true });
    setTimeout(() => {
      this.setState({ Show: false, Showing: false });
    }, 3000);
  };


  constructor(props) {
    super(props);

    this.state = {
      email: '',
      password: '',
      users: [],
      email_error: '',
      email_color: 'black',
      pass_error: '',
      pass_color: 'black',
      redirect: false,
      message: '',
      pop: '',
      selectedDay: undefined,
      columnDefs: [
        { field: 'athlete', width: "100%", sortingOrder: ['asc', 'desc'], },
        { field: 'age', width: "100%", sortingOrder: ['desc', 'asc'], },
        { field: 'country', width: "100%", sortingOrder: ['desc', null], },
        { field: 'year', width: "100%", sortingOrder: ['asc'], },
      ],
      defaultColDef: { width: '100%', sortable: true, },
      rowData: null,
      sortingOrder: ['desc', 'asc', null],
    };
    this.handleDayChange = this.handleDayChange.bind(this);

  }


  onGridReady = (params) => {
    this.gridApi = params.api;
    this.gridColumnApi = params.columnApi;

    const updateData = (data) => {
      this.setState({ rowData: data });
    };

    fetch('https://www.ag-grid.com/example-assets/olympic-winners.json')
      .then((resp) => resp.json())
      .then((data) => updateData(data));
  };

  handleDayChange(day) {
    this.setState({ selectedDay: day });
  }

  componentDidMount() { }
  render() {
    const rowData = [
      { make: "Toyota", model: "Celica", price: 35000 },
      { make: "Ford", model: "Mondeo", price: 32000 },
      { make: "Porsche", model: "Boxter", price: 72000 }
    ];
    return (
      <>




        <div class="kt-container  kt-container--fluid  kt-grid__item kt-grid__item--fluid">
          <div class="row">
            <div class="col-md-12">


              <div class="kt-portlet">



                <form class="kt-form">
                  <div class="kt-portlet__body">

                    <div class="row">
                      <div class="col-md-3">
                        <div class="form-group">
                          <label>First Name</label>
                          <input type="email" class="form-control" aria-describedby="emailHelp" placeholder="Enter First Name" />
                          <span class="form-text text-muted">We'll never share your email with anyone else.</span>
                        </div>
                      </div>

                      <div class="col-md-3">
                        <div class="form-group">
                          <label>Last Name</label>
                          <input type="email" class="form-control" aria-describedby="emailHelp" placeholder="Enter Last Name" />
                          <span class="form-text text-muted">We'll never share your email with anyone else.</span>
                        </div>
                      </div>

                      <div class="col-md-3">
                        <div class="form-group">
                          <label>D.O.B</label>

                          <div class="input-group date">
                            <DayPickerInput
                              style={{ "width": "250px" }}
                              class="form-control"
                              onChange={this.myChangeHandler}
                              formatDate={formatDate}
                              format='dd/MM/yyyy'
                              placeholder="DD/MM/YYYY"
                              onDayChange={e => {
                                var date = new Date(e);
                                let mnth = ("0" + (date.getMonth() + 1)).slice(-2),
                                  day = ("0" + date.getDate()).slice(-2);
                                let dob = [day, mnth, date.getFullYear()].join("/");
                                this.setState({ dob: dob })
                              }}
                            />
                          </div>



                          <span class="form-text text-muted">We'll never share your email with anyone else.</span>

                        </div>
                      </div>

                      <div class="col-md-3">
                        <div class="form-group">
                          <label>Gender</label>
                          <input type="email" class="form-control" aria-describedby="emailHelp" placeholder="Enter email" />
                          <span class="form-text text-muted">We'll never share your email with anyone else.</span>
                        </div>
                      </div>
                    </div>

                    <div class="row">
                      <div class="col-md-3">
                        <div class="form-group">
                          <label>MRN Root</label>
                          <input type="email" class="form-control" aria-describedby="emailHelp" placeholder="Enter MRN Root" />
                          <span class="form-text text-muted">We'll never share your email with anyone else.</span>
                        </div>
                      </div>

                      <div class="col-md-3">
                        <div class="form-group">
                          <label> MRN Extension</label>
                          <input type="email" class="form-control" aria-describedby="emailHelp" placeholder="Enter MRN Extension" />
                          <span class="form-text text-muted">We'll never share your email with anyone else.</span>
                        </div>
                      </div>

                      <div class="col-md-3">
                        <div class="form-group">
                          <label>Start Date</label>
                          <div class="input-group date">
                            <DayPickerInput
                              style={{ "width": "250px" }}
                              class="form-control"
                              onChange={this.myChangeHandler}
                              formatDate={formatDate}
                              format='dd/MM/yyyy'
                              placeholder="DD/MM/YYYY"
                              onDayChange={e => {
                                var date = new Date(e);
                                let mnth = ("0" + (date.getMonth() + 1)).slice(-2),
                                  day = ("0" + date.getDate()).slice(-2);
                                let dob = [day, mnth, date.getFullYear()].join("/");
                                this.setState({ startdate: dob })
                              }}
                            />
                          </div>
                          <span class="form-text text-muted">We'll never share your email with anyone else.</span>
                        </div>
                      </div>

                      <div class="col-md-3">
                        <div class="form-group">
                          <label>End Date</label>
                          <div class="input-group date">
                            <DayPickerInput
                              style={{ "width": "250px" }}
                              class="form-control"
                              onChange={this.myChangeHandler}
                              formatDate={formatDate}
                              format='dd/MM/yyyy'
                              placeholder="DD/MM/YYYY"
                              onDayChange={e => {
                                var date = new Date(e);
                                let mnth = ("0" + (date.getMonth() + 1)).slice(-2),
                                  day = ("0" + date.getDate()).slice(-2);
                                let dob = [day, mnth, date.getFullYear()].join("/");
                                this.setState({ enddate: dob })
                              }}
                            />
                          </div>
                          <span class="form-text text-muted">We'll never share your email with anyone else.</span>
                        </div>
                      </div>
                    </div>


                  </div>
                  <div class="kt-portlet__foot">
                    <div class="kt-form__actions">
                      <button type="reset" class="btn btn-primary"> Search </button> &nbsp;
                      <button type="reset" class="btn btn-secondary">Cancel</button>
                    </div>
                  </div>
                </form>

              </div>


            </div>
          </div>




        </div>














        <div class="kt-portlet kt-portlet--mobile">
          <div class="kt-portlet__head kt-portlet__head--lg">
            <div class="kt-portlet__head-label">
              <span class="kt-portlet__head-icon">
                <i class="kt-font-brand flaticon2-line-chart"></i>
              </span>
              <h3 class="kt-portlet__head-title">
                Local Datasource
              </h3>
            </div>
            <div class="kt-portlet__head-toolbar">
              <div class="kt-portlet__head-wrapper">
                <a href="#" class="btn btn-clean btn-icon-sm">
                  <i class="la la-long-arrow-left"></i>
                  Back
                </a>
                &nbsp;
                <div class="dropdown dropdown-inline">
                  <button type="button" class="btn btn-brand btn-icon-sm" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                    <i class="flaticon2-plus"></i> Add New
                  </button>
                  <div class="dropdown-menu dropdown-menu-right">
                    <ul class="kt-nav">
                      <li class="kt-nav__section kt-nav__section--first">
                        <span class="kt-nav__section-text">Choose an action:</span>
                      </li>
                      <li class="kt-nav__item">
                        <a href="#" class="kt-nav__link">
                          <i class="kt-nav__link-icon flaticon2-open-text-book"></i>
                          <span class="kt-nav__link-text">Reservations</span>
                        </a>
                      </li>
                      <li class="kt-nav__item">
                        <a href="#" class="kt-nav__link">
                          <i class="kt-nav__link-icon flaticon2-calendar-4"></i>
                          <span class="kt-nav__link-text">Appointments</span>
                        </a>
                      </li>
                      <li class="kt-nav__item">
                        <a href="#" class="kt-nav__link">
                          <i class="kt-nav__link-icon flaticon2-bell-alarm-symbol"></i>
                          <span class="kt-nav__link-text">Reminders</span>
                        </a>
                      </li>
                      <li class="kt-nav__item">
                        <a href="#" class="kt-nav__link">
                          <i class="kt-nav__link-icon flaticon2-contract"></i>
                          <span class="kt-nav__link-text">Announcements</span>
                        </a>
                      </li>
                      <li class="kt-nav__item">
                        <a href="#" class="kt-nav__link">
                          <i class="kt-nav__link-icon flaticon2-shopping-cart-1"></i>
                          <span class="kt-nav__link-text">Orders</span>
                        </a>
                      </li>
                      <li class="kt-nav__separator kt-nav__separator--fit">
                      </li>
                      <li class="kt-nav__item">
                        <a href="#" class="kt-nav__link">
                          <i class="kt-nav__link-icon flaticon2-rocket-1"></i>
                          <span class="kt-nav__link-text">Projects</span>
                        </a>
                      </li>
                      <li class="kt-nav__item">
                        <a href="#" class="kt-nav__link">
                          <i class="kt-nav__link-icon flaticon2-chat-1"></i>
                          <span class="kt-nav__link-text">User Feedbacks</span>
                        </a>
                      </li>
                    </ul>
                  </div>
                </div>
              </div>
            </div>
          </div>
          <div class="kt-portlet__body">


           

          </div>
          <div class="kt-portlet__body kt-portlet__body--fit">


            <div class="kt-datatable kt-datatable--default kt-datatable--brand kt-datatable--loaded" id="local_data">
            <div style={{ width: '100%', height: '100%' }}>
                        <div id="myGrid" style={{ height: '100%', width: '100%', }} className="ag-theme-alpine" >
                          <AgGridReact
                            columnDefs={this.state.columnDefs}
                            defaultColDef={this.state.defaultColDef}
                            rowData={this.state.rowData}
                            animateRows={true}
                            sortingOrder={this.state.sortingOrder}
                            onGridReady={this.onGridReady}
                          />
                        </div>
                      </div>
								</div>
							</div>
							</div>

                     

                  
           
                            




      </>
                      );
  }
}
